import React, { useEffect, useState } from "react";

function App() {
  const [loaded, setLoaded] = useState(false);

  useEffect(() => {
    setTimeout(() => setLoaded(true), 300);
  }, []);

  return (
    <div
      style={{
        backgroundColor: "#000",
        minHeight: "100vh",
        fontFamily: "Poppins, sans-serif",
        color: "#fff",
        overflow: "hidden",
        position: "relative",
      }}
    >
      {/* Animated gold particles */}
      <div
        style={{
          position: "absolute",
          inset: 0,
          background:
            "radial-gradient(circle at 20% 30%, rgba(255,215,0,0.05) 0%, transparent 60%), radial-gradient(circle at 80% 70%, rgba(255,215,0,0.05) 0%, transparent 60%)",
          animation: "moveBg 10s infinite alternate",
          zIndex: 0,
        }}
      ></div>

      {/* Main content */}
      <div
        style={{
          position: "relative",
          zIndex: 2,
          textAlign: "center",
          paddingTop: "80px",
          opacity: loaded ? 1 : 0,
          transform: loaded ? "translateY(0)" : "translateY(30px)",
          transition: "all 1.5s ease",
        }}
      >
        {/* Logo with golden light animation */}
        <div
          style={{
            position: "relative",
            display: "inline-block",
            marginBottom: "25px",
          }}
        >
          <img
            src="/logo.png"
            alt="Target Marketing Logo"
            style={{
              width: "200px",
              filter:
                "drop-shadow(0 0 25px rgba(255,215,0,0.8)) drop-shadow(0 0 60px rgba(255,215,0,0.3))",
              animation: "logoReveal 2.5s ease forwards",
              opacity: 0,
            }}
          />
          {/* golden glow under logo */}
          <div
            style={{
              position: "absolute",
              bottom: "-10px",
              left: "50%",
              transform: "translateX(-50%)",
              width: "180px",
              height: "25px",
              background:
                "radial-gradient(circle, rgba(255,215,0,0.6) 0%, transparent 80%)",
              filter: "blur(15px)",
              animation: "glowPulse 3s infinite ease-in-out",
            }}
          ></div>
        </div>

        {/* Title */}
        <h1
          style={{
            fontSize: "3.8rem",
            fontWeight: 800,
            color: "#FFD700",
            textShadow:
              "0 0 30px #FFD700, 0 0 60px rgba(255,215,0,0.7), 0 0 100px rgba(255,215,0,0.4)",
            letterSpacing: "1px",
            marginBottom: "15px",
          }}
        >
          TARGET MARKETING ACADEMY
        </h1>

        {/* Subtitle */}
        <p
          style={{
            fontSize: "1.4rem",
            color: "#eee",
            textShadow: "0 0 15px rgba(255,255,255,0.3)",
          }}
        >
          Innovation. Intelligence. Impact.
        </p>

        {/* Description */}
        <p
          style={{
            maxWidth: "750px",
            margin: "25px auto 60px auto",
            color: "#bbb",
            fontSize: "1.1rem",
            lineHeight: "1.8",
          }}
        >
          Explore the{" "}
          <span style={{ color: "#FFD700", fontWeight: 600 }}>GPS</span>{" "}
          ecosystem — <b>Trading</b>, <b>Marketing</b>, <b>Dropshipping</b>,{" "}
          <b>Languages</b>, and <b>Design Studio</b> — where education meets
          innovation powered by{" "}
          <span style={{ color: "#FFD700", fontWeight: 600 }}>AI</span>.
        </p>

        {/* Buttons */}
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            flexWrap: "wrap",
            gap: "20px",
            maxWidth: "900px",
            margin: "0 auto",
          }}
        >
          {[
            "GPS TRADING",
            "GPS MARKETING",
            "GPS DROPSHIPPING",
            "GPS LANGUAGES",
            "GPS STUDIO",
          ].map((item, i) => (
            <button
              key={i}
              style={{
                background:
                  "linear-gradient(135deg, #FFD700 0%, #b8860b 100%)",
                color: "#000",
                border: "none",
                borderRadius: "12px",
                padding: "16px 28px",
                fontWeight: "700",
                cursor: "pointer",
                boxShadow:
                  "0 0 20px rgba(255,215,0,0.3), inset 0 0 10px rgba(255,255,255,0.1)",
                transition: "all 0.4s ease",
              }}
              onMouseOver={(e) => {
                e.target.style.transform = "translateY(-5px) scale(1.05)";
                e.target.style.boxShadow =
                  "0 0 40px rgba(255,215,0,0.8), 0 0 80px rgba(255,215,0,0.5)";
              }}
              onMouseOut={(e) => {
                e.target.style.transform = "translateY(0) scale(1)";
                e.target.style.boxShadow =
                  "0 0 20px rgba(255,215,0,0.3), inset 0 0 10px rgba(255,255,255,0.1)";
              }}
            >
              {item}
            </button>
          ))}
        </div>
      </div>

      {/* Footer */}
      <footer
        style={{
          position: "absolute",
          bottom: "20px",
          width: "100%",
          textAlign: "center",
          color: "#777",
          fontSize: "0.9rem",
          letterSpacing: "0.5px",
        }}
      >
        © 2025 Target Marketing Systems | Powered by GPS AI
      </footer>

      {/* CSS Animations */}
      <style>
        {`
          @keyframes moveBg {
            0% { background-position: 0 0, 0 0; }
            100% { background-position: 100px 100px, -100px -100px; }
          }

          @keyframes logoReveal {
            0% {
              transform: translateY(50px) scale(0.8);
              opacity: 0;
              filter: brightness(0) blur(20px);
            }
            60% {
              opacity: 1;
              filter: brightness(1.2) blur(0);
            }
            100% {
              transform: translateY(0) scale(1);
              opacity: 1;
            }
          }

          @keyframes glowPulse {
            0% { opacity: 0.4; transform: scaleX(1); }
            50% { opacity: 0.9; transform: scaleX(1.2); }
            100% { opacity: 0.4; transform: scaleX(1); }
          }
        `}
      </style>
    </div>
  );
}

export default App;
